import React, { Component } from 'react';
import Navbar from './Navbar';
import { Container } from 'react-bootstrap'
import axios from 'axios';
import cookie from 'universal-cookie';
import Cookies from 'universal-cookie';
const Cookie = new cookie();

class Home extends Component {
    constructor(props){
        super(props);
    }
    async componentDidMount(){
        await axios.get('http://localhost:3001/post/postnews')
        if(Cookie.get('token')){
            await axios.post('http://localhost:3001/user/verify',{data:{token:Cookie.get('token')}}).then(x=>{console.log(x)})
        }else{
            console.log("ko lay dc")
        }
    }
    render() {
        return (
            <Container fluid>
                <Navbar login={true}>
                </Navbar>
            </Container>
        );
    }
}

export default Home;
